import React from 'react'
import { useSelector } from 'react-redux';

function MessageList() {
  const listMessages = useSelector((state) => state.messageReducer.listOrders);

  const dispatch = useDispatch();

  useEffect(() => {
    dispatch(getOrders());
  }, [dispatch]);

  return (
    <div>MessageList</div>
  )
}

export default MessageList
